import React from 'react';

const Home: React.FC = () => {
  return (
    <div className="mt-12 mb-12 flex flex-col items-center">
      <div>
        Welcome to UVID
    </div>
      <div>
        <input className="text-black text-center" type="text" placeholder="Please enter your name" />
      </div>
      <div>
        <button>
          Create a room
      </button>
      </div>
    </div>
  )
};

export default Home;
